import React from 'react';
import './main.css';
import './App.css';
import { Row, Col } from 'react-bootstrap';

function Details(linkProps) {
  console.log(JSON.parse(linkProps.location.state));
  const props = JSON.parse(linkProps.location.state);
  return (
    <div className="Details">
      <Col md={12} lg={10}>
        <h2>{props.title}</h2>

        <div dangerouslySetInnerHTML={ JSON.stringify(props.description)}></div>

        <h3>Materials</h3>

      </Col>


    </div>
  );
}

export default Details;
